import "./App.css";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import {
  HomePageContainer,
  CampusContainer,
  StudentContainer,
  AllCampusesContainer,
  AllStudentsContainer,
  NewStudentContainer,
} from './components/containers';
import AddCampusContainer from './components/containers/AddCampusContainer';

const App = () => {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<HomePageContainer />} />
        <Route path="/campuses" element={<AllCampusesContainer />} />
        <Route path="/campus/:id" element={<CampusContainer />} />
        <Route path="/students" element={<AllStudentsContainer />} />
        <Route path="/newstudent" element={<NewStudentContainer />} />
        <Route path="/add-campus" element={<AddCampusContainer />} />
      </Routes>
    </Router>
  );
}

export default App;
